import React from 'react'
import { BrowserRouter as Router } from 'react-router-dom'
import { Navbar } from '../components/Navbar'
import { Sidebar } from '../components/Sidebar'

export const Home = () => {
    return (
        <Router>
            <Sidebar />
            <Navbar />
        </Router>
    )
}
